import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Pages
import AdminLoginPage from './pages/AdminLoginPage';
import VoterLoginPage from './pages/VoterLoginPage';
import RegisterPage from './pages/RegisterPage';
import AdminDashboard from './pages/AdminDashboard';
import VoterDashboard from './pages/VoterDashboard';
import CandidatePage from './pages/CandidatePage';
import VotePage from './pages/VotePage';
import ResultsPage from './pages/ResultsPage';
import LandingPage from './pages/LandingPage';
import ManageCandidates from './pages/ManageCandidates'; // ✅ Add this if you haven't already

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/admin-login" element={<AdminLoginPage />} />
        <Route path="/voter-login" element={<VoterLoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/admin-dashboard" element={<AdminDashboard />} />
        <Route path="/voter-dashboard" element={<VoterDashboard />} />
        <Route path="/candidates" element={<CandidatePage />} />
        <Route path="/vote" element={<VotePage />} />
        <Route path="/results" element={<ResultsPage />} />
        <Route path="/admin/manage-candidates" element={<ManageCandidates />} /> {/* ✅ Add candidate management route */}
      </Routes>
    </Router>
  );
}

export default App;
